PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?player ?playerLabel ?team ?teamLabel WHERE {
  VALUES ?player {
    wd:Q169452 wd:Q25369
  }
  ?player p:P54 ?statement .
  ?statement ps:P54 ?team .
  ?statement pq:P580 ?start .
  ?statement pq:P582 ?end .
  FILTER ( ?start <= "2000-12-31T23:59:59Z" ^^ xsd:dateTime && ?end >= "2000-01-01T00:00:00Z" ^^ xsd:dateTime ) FILTER ( ?team = wd:Q121783 ) OPTIONAL {
    ?player rdfs:label ?playerLabel FILTER ( LANG( ?playerLabel ) = "en" )
  }
  OPTIONAL {
    ?team rdfs:label ?teamLabel FILTER ( LANG( ?teamLabel ) = "en" )
  }
}

